
function eliminarCoti(id_coti) {
    const url = "../control/eliminarCoti.php";
    const formaData = new FormData();
    formaData.append("id_coti", id_coti);

    fetch(url, {
        method: "POST",
        body: formaData,
    })
        .then(response => response.json())
        .then(data => {
            eliminacion.innerHTML = data.data;
            // Cierra la ventana modal actual sin jQuery
            document.querySelector(".modal").classList.remove("show");
            document.querySelector(".modal-backdrop").remove();

            location.reload();
        })
        .catch(err => {
            console.error("Error al eliminar el cliente:", err);
            // Maneja el error de manera explícita (puedes mostrar un mensaje de error o realizar otras acciones necesarias)
        });
}

// Función para redirigir y enviar datos por POST
function redirectToPageWithData(url, postData) {
    // Crea un formulario dinámico
    var form = document.createElement('form');
    form.method = 'post';
    form.action = url;

    // Agrega campos de entrada para cada par clave-valor en los datos
    for (var key in postData) {
        if (postData.hasOwnProperty(key)) {
            var input = document.createElement('input');
            input.type = 'hidden';
            input.name = key;
            input.value = postData[key];
            form.appendChild(input);
        }
    }

    // Agrega el formulario al cuerpo del documento
    document.body.appendChild(form);

    // Envía el formulario
    form.submit();
}

