function registrarCoti(){
    const requiredInputs = document.querySelectorAll('#formCoti [required]');
    
    // Verificar que los campos requeridos no estén vacíos
    let camposVacios = false;
    let primerInputVacio = null;

    requiredInputs.forEach(input => {
        if (input.value.trim() === '') {
            camposVacios = true;

            // Si es el primer campo vacío, asignar el foco a ese campo
            if (!primerInputVacio) {
                primerInputVacio = input;
            }
        }
    });

    // Si hay campos vacíos, mostrar una alerta y asignar el foco al primer campo vacío
    if (camposVacios) {
        mostrarAlerta('danger', 'Por favor, complete todos los campos requeridos.');
        
        if (primerInputVacio) {
            primerInputVacio.focus();
        }
        
        removeAlert();

        return;
    }

    // Deshabilitar el botón de enviar
    document.getElementById('btnEnviar').disabled = true;

    const formaData = new FormData(document.getElementById('formCoti'));

    const existeCampo = formaData.has('idproducto[]');
    if(existeCampo){
        fetch(document.getElementById('formCoti').action, {
            method: document.getElementById('formCoti').method,
            body: formaData,
        })
            .then(response => response.json())
            .then(data => {
                mostrarAlerta(data.tipo, data.mensaje);
    
                if(data.redir == true){
                    window.location.href = "../vistas/listacotizacion.php";
                }else{
                    // Volver a habilitar el botón de enviar después de la consulta
                    document.getElementById('btnEnviar').disabled = false;
                }
            })
            .catch(error => {
                mostrarAlerta('danger', error);
            });
            
            removeAlert();
    }else{
        document.getElementById('btnEnviar').disabled = false;
        mostrarAlerta('danger', 'Debe seleccionar al menos un producto');
    }
}

function editarCoti(){
    // Deshabilitar el botón de enviar
    document.getElementById('btnEnviar').disabled = true;

    const formaData = new FormData(document.getElementById('formCoti'));

    fetch(document.getElementById('formCoti').action, {
        method: document.getElementById('formCoti').method,
        body: formaData,
    })
        .then(response => response.json())
        .then(data => {
            mostrarAlerta(data.tipo, data.mensaje);

            if(data.redir == true){
                setTimeout(function() {
                    window.location.href = "../vistas/listacotizacion.php";
                }, 1000);
            }else{
                // Volver a habilitar el botón de enviar después de la consulta
                document.getElementById('btnEnviar').disabled = false;
            }
        })
        .catch(error => {
            mostrarAlerta('danger', error);
        });
        
        removeAlert();
}

